msg('Start: Inserting Security Data')
//Delete all Objects-Functionality associations For Each //SecObjectFunctionalities Defined By SecObjectName, SecFunctionalityId Delete EndFor
//Delete all Objects For Each //SecObject Defined By SecObjectName Delete EndFor
//Change all Functionalities to 'Inactive' and reset Parent For Each //SecFunctionality SecFunctionalityActive = False SecParentFunctionalityId.SetNull() EndFor
Commit
&SecFunctionalitiesToLoadCollection = SecGetAdvancedSecurityWWPFunctionalities()
//Create and update all Functionalities For &SecFunctionalitiesToLoad in &SecFunctionalitiesToLoadCollection For &SecFunctionalityKey in &SecFunctionalitiesToLoad.SecFunctionalityKeys For Each //SecFunctionality Where SecFunctionalityKey = &SecFunctionalityKey SecParentFunctionalityId.SetNull() SecFunctionalityActive = True SecFunctionalityType.SetEmpty() When None New //SecFunctionality SecFunctionalityKey = &SecFunctionalityKey SecFunctionalityDescription = &SecFunctionalityKey SecParentFunctionalityId.SetNull() SecFunctionalityActive = True SecFunctionalityType.SetEmpty() EndNew EndFor EndFor EndFor
//Delete Functionalities (and their associations) that are no longer used For Each //SecFunctionality Where SecFunctionalityActive = False For Each //SecFunctionalityRole Defined By SecRoleId, SecFunctionalityId Delete EndFor Delete EndFor
//Update Functionalities Type and Parents (for Actions, Tabs, and Modes) For &SecFunctionalitiesToLoad in &SecFunctionalitiesToLoadCollection For &SecFunctionalityKey in &SecFunctionalitiesToLoad.SecFunctionalityKeys For Each //SecFunctionality Where SecFunctionalityKey = &SecFunctionalityKey //Update Functionality Type If SecFunctionalityType.IsEmpty() SecFunctionalityType = &SecFunctionalitiesToLoad.SecFunctionalityType Else If SecFunctionalityType <> &SecFunctionalitiesToLoad.SecFunctionalityType SecFunctionalityType = WWPSecFunctionalityTypes.Object SecParentFunctionalityId.SetNull() EndIf EndIf
//Update Functionality Parent If SecFunctionalityType <> WWPSecFunctionalityTypes.Object AND not &SecFunctionalitiesToLoad.SecParentFunctionalityKey.IsEmpty() &SecFunctionalityKeyToFilter = &SecFunctionalitiesToLoad.SecParentFunctionalityKey Do 'GetFunctionalityIdByKey' If SecParentFunctionalityId <> &SecFunctionalityId If SecParentFunctionalityId.IsNull() AND (not &SecFunctionalityId.IsEmpty()) AND SecFunctionalityActive SecParentFunctionalityId = &SecFunctionalityId Else // The SecFunctionalityActive is used to tag Functionalities that will have Empty Parent (because they have more than one parent) SecFunctionalityActive = False SecParentFunctionalityId.SetNull() EndIf EndIf EndIf EndFor EndFor EndFor
//Update SecFunctionalityActive For Each //SecFunctionality Where SecFunctionalityActive = False SecFunctionalityActive = True EndFor
//Create All Objects and Objects-Functionality association For &SecFunctionalitiesToLoad in &SecFunctionalitiesToLoadCollection If Not &SecFunctionalitiesToLoad.SecObjectName.IsEmpty() New //SecObject SecObjectName = trim(lower(&SecFunctionalitiesToLoad.SecObjectName)) EndNew For &SecFunctionalityKey in &SecFunctionalitiesToLoad.SecFunctionalityKeys &SecFunctionalityKeyToFilter = &SecFunctionalityKey Do 'GetFunctionalityIdByKey' If not &SecFunctionalityId.IsEmpty() New //SecObjectFunctionalities SecObjectName = trim(lower(&SecFunctionalitiesToLoad.SecObjectName)) SecFunctionalityId = &SecFunctionalityId EndNew Else msg('Error: SecFunctionalityId not found, SecFunctionalityKey: ' + &SecFunctionalityKey) EndIf EndFor EndIf EndFor
Commit
msg('End: Inserting Security Data')
Sub 'GetFunctionalityIdByKey'
&SecFunctionalityId = Find(SecFunctionalityId, SecFunctionalityKey = &SecFunctionalityKeyToFilter, 0) If &SecFunctionalityId.IsEmpty() msg('Error: Functionality not found, SecFunctionalityKey: ' + &SecFunctionalityKeyToFilter) EndIf
EndSub

